import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the first "Your Profile" link
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile page to load and take screenshot
    await page.waitForSelector('.profile-header', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_loaded.png'));

    // Extract profile data to verify we're on Jun's profile
    const profileData = await page.evaluate(() => {
      const profileImage = document.querySelector('.profile-image');
      const profileName = document.querySelector('.profile-info h2');
      const username = document.querySelector('.username');
      const stats = document.querySelectorAll('.stat-number');

      return {
        profileImage: profileImage ? profileImage.src : null,
        fullName: profileName ? profileName.textContent : null,
        username: username ? username.textContent : null,
        ordersCount: stats[0] ? stats[0].textContent : null,
        reviewsCount: stats[1] ? stats[1].textContent : null,
        rating: stats[2] ? stats[2].textContent : null
      };
    });

    return {
      success: true,
      action: "Navigated to Jun's Profile and extracted profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
